   367→
   368→        <h2 id="The_Seven_Strata">The Seven Strata<span class="mw-editsection">[<a href="/wiki/Psychostrata?action=edit&section=1">edit</a>]</span></h2>
   369→        <p>Okonkwo's canonical model identifies seven distinct psychostrata, numbered from the surface (most accessible) downward to the deepest and most fundamental. Each stratum possesses characteristic properties regarding accessibility, content type, and temporal range.<sup><a href="#cite3">[3]</a></sup></p>
   370→
   371→        <table class="wikitable">
   372→            <tr>
   373→                <th>Stratum</th>
   374→                <th>Name</th>
   375→                <th>Temporal range</th>
   376→                <th>Accessibility</th>
   377→                <th>Content characteristics</th>
   378→            </tr>
   379→            <tr>
   380→                <td><b>I</b></td>
   381→                <td>Present</td>
   382→                <td>Immediate moment</td>
   383→                <td>Fully conscious</td>
   384→                <td>Current sensory experience, active working memory</td>
   385→            </tr>
   386→            <tr>
   387→                <td><b>II</b></td>
   388→                <td>Recent</td>
   389→                <td>Days to weeks</td>
   390→                <td>Easily recalled</td>
   391→                <td>Fresh episodic memories, recent experiences</td>
   392→            </tr>
   393→            <tr>
   394→                <td><b>III</b></td>
   395→                <td>Consolidated</td>
   396→                <td>Months to years</td>
   397→                <td>Retrievable with effort</td>
   398→                <td>Firmly encoded autobiographical memories</td>
   399→            </tr>
   400→            <tr>
   401→                <td><b>IV</b></td>
   402→                <td>Compressed</td>
   403→                <td>Years to decades</td>
   404→                <td>Partially accessible</td>
   405→                <td>Merged memories, composite recollections</td>
   406→            </tr>
   407→            <tr>
   408→                <td><b>V</b></td>
   409→                <td>Fossilized</td>
   410→                <td>Decades+</td>
   411→                <td>Excavation required</td>
   412→                <td>Cognitive fossils, crystallized personality traits</td>
   413→            </tr>
   414→            <tr>
   415→                <td><b>VI</b></td>
   416→                <td>Ancestral</td>
   417→                <td>Transgenerational</td>
   418→                <td>Deep excavation only</td>
   419→                <td>Inherited cognitive patterns (controversial)</td>
   420→            </tr>
   421→            <tr>
   422→                <td><b>VII</b></td>
   423→                <td>Bedrock</td>
   424→                <td>Atemporal</td>
   425→                <td>Rarely accessible</td>
   426→                <td>Fundamental structures of consciousness</td>
   427→            </tr>
   428→        </table>
   429→
   430→        <p>The boundaries between strata are not sharp demarcations but rather <b>transitional zones</b> where materials from adjacent layers intermingle. Okonkwo termed these zones "cognitive ecotones," borrowing from ecological terminology to describe regions of heightened complexity and interaction.<sup><a href="#cite4">[4]</a></sup></p>
   431→
   432→        <h2 id="Formation_and_compression">Formation and compression<span class="mw-editsection">[<a href="/wiki/Psychostrata?action=edit&section=2">edit</a>]</span></h2>
   433→
   434→        <h3 id="Sedimentation">Sedimentation</h3>
   435→        <p>Each moment of conscious experience deposits what Okonkwo termed <b>mental sediment</b>—the experiential residue that accumulates to form the psychostrata. The rate of sedimentation varies significantly based on emotional intensity, attention, and novelty. Highly charged experiences deposit thicker layers, while routine or inattentive moments leave only thin traces.<sup><a href="#cite5">[5]</a></sup></p>
   436→
   437→        <p>The composition of mental sediment includes:</p>
   438→        <ul>
   439→            <li><b>Sensory particles:</b> Traces of perceptual experience (visual, auditory, olfactory, etc.)</li>
   440→            <li><b>Affective minerals:</b> Emotional coloration that becomes embedded in the memory</li>
   441→            <li><b>Semantic crystals:</b> Meaning-structures that form around experiences</li>
   442→            <li><b>Contextual clays:</b> Environmental and situational information<sup><a href="#cite6">[6]</a></sup></li>
   443→        </ul>
   444→
   445→        <h3 id="Compaction">Compaction</h3>
   446→        <p>As new sediment accumulates, underlying layers undergo compaction—a process wherein individual memories lose detail and become compressed into denser forms. The compaction rate follows what Okonkwo called the <b>Depth-Density Law</b>: for every doubling of depth, memory density increases by a factor of approximately 1.7, while retrievable detail decreases by roughly half.<sup><a href="#cite7">[7]</a></sup></p>
   447→
   448→        <p>Factors accelerating compaction include:</p>
   449→        <ul>
   450→            <li>Insufficient sleep (disrupts consolidation processes)</li>
   451→            <li>Chronic stress (increases "overburden pressure")</li>
   452→            <li><a href="temporal-debt.html">Temporal debt</a> accumulation</li>
   453→            <li>Information overload (excessive sedimentation rate)<sup><a href="#cite8">[8]</a></sup></li>
   454→        </ul>
   455→
   456→        <h3 id="Fossilization">Fossilization</h3>
   457→        <p>At sufficient depth—typically Stratum V and below—compressed memories undergo a qualitative transformation termed <b>cognitive fossilization</b>. Fossilized memories can no longer be "recalled" in the conventional sense; they have instead become structural elements of personality and cognition. A fossilized fear, for instance, manifests not as a remembered frightening event but as an inexplicable aversion or anxiety pattern.<sup><a href="#cite9">[9]</a></sup></p>
   458→
   459→        <blockquote>
   460→            "The paradox of deep memory: the more completely we forget something, the more completely it becomes us. The fossil does not remember the creature; the fossil <i>is</i> the creature, transformed."<br>
   461→            — Dr. Amara Okonkwo, 1982
   462→        </blockquote>
   463→
   464→        <h2 id="Inter-strata_phenomena">Inter-strata phenomena<span class="mw-editsection">[<a href="/wiki/Psychostrata?action=edit&section=3">edit</a>]</span></h2>
   465→        <p>The psychostrata do not exist in complete isolation; various phenomena involve interaction between layers:</p>
   466→
   467→        <ul>
   468→            <li><b>Upwelling:</b> Spontaneous emergence of deeper material to surface consciousness, often triggered by sensory cues or emotional states. Dreams are theorized to represent natural upwelling events.<sup><a href="#cite10">[10]</a></sup></li>
   469→            <li><b>Intrusion:</b> Forceful breakthrough of fossilized material, as in flashbacks or triggered responses</li>
   470→            <li><b>Leaching:</b> Gradual seepage of emotional content from deeper strata into surface experience, coloring present consciousness with ancient affects</li>
   471→            <li><b>Fault lines:</b> Structural weaknesses in the strata that allow cross-layer communication, often formed by trauma<sup><a href="#cite11">[11]</a></sup></li>
   472→        </ul>
   473→
   474→        <p>Research conducted through the <a href="mnemonic-commons.html">Collective Memory Project</a> has suggested that certain inter-strata phenomena may occur not just within individual minds but across the shared substrates of mnemonic commons, potentially explaining cultural shifts in mood or collective flashbacks to historical events.<sup><a href="#cite12">[12]</a></sup></p>
   475→
   476→        <h2 id="Measurement">Measurement and mapping<span class="mw-editsection">[<a href="/wiki/Psychostrata?action=edit&section=4">edit</a>]</span></h2>
   477→        <p>Consciousness archaeologists have developed several metrics for describing psychostrata:</p>
   478→
   479→        <ul>
   480→            <li><b>Stratal depth:</b> Measured in <b>Okonkwo Units (Ou)</b>, representing the number of consolidation cycles separating content from surface consciousness</li>
   481→            <li><b>Compaction index:</b> The degree of memory compression at a given depth, ranging from 1.0 (uncompacted) to theoretical maximum of 7.0 (fully fossilized)</li>
   482→            <li><b>Accessibility quotient:</b> Probability that material at a given depth can be retrieved through standard recall</li>
   483→            <li><b>Emotional specific gravity:</b> The "weight" of affective content at various depths<sup><a href="#cite13">[13]</a></sup></li>
   484→        </ul>
   485→
   486→        <p>The <i>Atlas of the Psychostrata</i>, compiled by Okonkwo and Brennan in 1980 and updated periodically since, provides standardized maps and cross-sections derived from thousands of excavation sessions. The atlas remains the primary reference for practitioners, though its accuracy and generalizability are disputed.<sup><a href="#cite14">[14]</a></sup></p>
   487→
   488→        <h2 id="Clinical_applications">Clinical applications<span class="mw-editsection">[<a href="/wiki/Psychostrata?action=edit&section=5">edit</a>]</span></h2>
   489→        <p>Understanding of psychostrata has informed several therapeutic approaches:</p>
   490→
   491→        <ul>
   492→            <li><b>Stratified trauma therapy:</b> Treating traumatic material differently depending on its current stratal position, with surface trauma addressed through processing and deep fossils approached through indirect methods</li>
   493→            <li><b>Controlled upwelling:</b> Therapeutic techniques designed to safely bring deeper material to surface consciousness for integration</li>
   494→            <li><b>Compaction prevention:</b> Interventions aimed at slowing maladaptive compaction, particularly in individuals experiencing chronic <a href="temporal-debt.html">temporal debt</a></li>
   495→            <li><b>Stratal mapping:</b> Diagnostic use of excavation techniques to understand the geological structure of a patient's psyche<sup><a href="#cite15">[15]</a></sup></li>
   496→        </ul>
   497→
   498→        <p>Some practitioners have proposed connections between psychostratal integrity and <a href="semantic-hygiene.html">semantic hygiene</a>, suggesting that vocabulary decay in <a href="ghost-vocabulary.html">ghost vocabulary</a> may correlate with disruptions in the upper strata.<sup><a href="#cite16">[16]</a></sup></p>
   499→
   500→        <h2 id="Criticism">Criticism<span class="mw-editsection">[<a href="/wiki/Psychostrata?action=edit&section=6">edit</a>]</span></h2>
   501→        <p>The psychostrata model has attracted significant criticism from mainstream cognitive science and neuroscience:</p>
   502→
   503→        <ul>
   504→            <li>The geological metaphor is considered to lack empirical grounding; actual memory storage does not appear to be layered in any physical sense</li>
   505→            <li>The number and characteristics of strata appear arbitrary and vary across different practitioners' descriptions</li>
   506→            <li>Stratum VI (Ancestral) invokes mechanisms with no known biological basis, resembling discredited theories of <a href="/wiki/Lamarckism">inherited memory</a></li>
   507→            <li>The model's predictions are often unfalsifiable, as failed excavations can always be attributed to insufficient technique rather than absence of material</li>
   508→            <li>Critics argue the model conflates metaphor with mechanism, treating a useful therapeutic image as literal truth<sup><a href="#cite17">[17]</a></sup></li>
   509→        </ul>
   510→
   511→        <p>Defenders respond that the model is explicitly metaphorical and that its clinical utility does not depend on literal geological accuracy. Okonkwo herself wrote in 1990: "The map is not the territory; but without maps, we cannot navigate territory at all."<sup><a href="#cite18">[18]</a></sup></p>
